  `fecha_alta` datetime DEFAULT NULL,
  `fecha_modifica` datetime DEFAULT NULL,
  `usuario_id` int NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3005 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='id: primary key\nactive: sirve para no tener que eliminar por completo de la base de datos, si active = 0 quiere decir que la tupla esta eliminada. Esta validacion del lado del cliente se tiene que hacer siempre, es decir checkear que active = 1 para mostrar los datos, ya que lo valores con active = 0 son todos los que se han eliminado.\n\nTodos los campos que hacen referencia a otra tabla (llaves foraneas) tienen esta sintaxis ''nombretabla_id''\nproveedor_id: id de la tabla de proveedores\nStatus: 1 quiere decir encabezado creado, no tiene registros la tabla ingreso_d por  el momento.\n	2 quiere decir que ya se ingresaron registros en la tabla ingreso_d\n	3 Quiere decir que ya se cerro el ingreso, sin embargo todavia esta pendiente de pago. Al pasar a estado 3 se hacen 	\n	   los ingreso a inventario y a inventario_d\n	4 Quiere decir que ya se empezaron a realizar los pagos pero todavia tiene deuda (por si hay abonos a una factura)\n	5 Quiere decir que ya se completaron todos los pagos\n\n	factura: es el numero de factura del proveedor\n	fecha_factura: fecha en que se emitio la factura por el proveedor\n	fecha_estimado: fecha en la que entra el producto a guatemala aproximadamente (para importaciones)	\n	poliza: poliza de importacion\n	observaciones: cualquier cosa que se quiera agregar de esta orden de compra\n	fecha_alta: fecha y hora en la que se creo la orden de compra\n	fecha_modifica: la ultima fecha en la que se hizo un update a la tabla\n	usuario_id: el ultimo usuario que hizo un update a la tabla';
